[TextBlock(text='[
  {
    "sid": "613",
    "Technique ID": "T1595",
    "Technique Name": "Active Scanning",
    "Quotes": [
      "Adversaries may execute active reconnaissance scans to gather information that can be used during targeting"
    ],
    "Explanation": "The Snort rule is designed to detect active scanning attempts from external networks to the internal network, which aligns with the T1595 'Active Scanning' technique from MITRE ATT&CK."
  },
  {
    "sid": "613", 
    "Technique ID": "T1046",
    "Technique Name": "Network Service Discovery",
    "Quotes": [
      "Adversaries may attempt to get a listing of services running on remote hosts and local network infrastructure devices, including those that may be vulnerable to remote software exploitation"
    ],
    "Explanation": "The Snort rule is looking for traffic on a non-standard port (10101), which could be an attempt to discover network services running on the internal network, aligning with the T1046 'Network Service Discovery' technique."
  }
