[TextBlock(text='[
  {
    "sid": "31830",
    "Technique ID": "T1110",
    "Technique name": "Brute Force",
    "Quotes": [
      "Adversaries may use brute force techniques to gain access to accounts when passwords are unknown or when password hashes are obtained"
    ],
    "Explanation": "The Snort rule is designed to detect brute force attempts against the default FTP login credentials on QLogic switches. The rule looks for the string 'PASS' followed by a specific pattern, which suggests an attempt to guess the password."
  },
